import React, { useState } from 'react';
import axios from 'axios';

function AdminPage() {
    const [carInfo, setCarInfo] = useState({
        vin: '',
        exterior_color: '',
        interior_color: '',
        make: '',
        model: '',
        fuel: '',
        year: '',
        list_time: '',
        list_price: '',
        current_mileage: '',
    });
    const [carImage, setCarImage] = useState(null);
    const [error, setError] = useState('');

    const handleChange = (e) => {
        setCarInfo({ ...carInfo, [e.target.name]: e.target.value });
    };

    const handleImageChange = (e) => {
        setCarImage(e.target.files[0]);
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        const formData = new FormData();
        Object.entries(carInfo).forEach(([key, value]) => {
            formData.append(key, value);
        });
        if (carImage) {
            formData.append('image', carImage);
        }

        try {
            const response = await axios.post(`${process.env.REACT_APP_API_URL}add-car/`, formData, {
                headers: {
                    'Content-Type': 'multipart/form-data',
                },
            });
            console.log(response.data);
            // Handle success (e.g., clear form, show success message)
        } catch (error) {
            setError(error.response?.data?.message || 'Error adding car');
        }
    };

    return (
        <div className="admin-page">
            <h2>Add Car</h2>
            <form onSubmit={handleSubmit} encType="multipart/form-data">
                {/* Your input fields here */}
                <button type="submit">Add Car</button>
                {error && <div className="error-message">{error}</div>}
            </form>
        </div>
    );
}

export default AdminPage;
